import { Box } from '@mui/material'
import React from 'react'

function SubHeader() {
    return (
        <Box sx={{
            bgcolor: 'lightgrey',
            width: '100%',
        }}>
            <Box>
                sub header
            </Box>
        </Box>
    )
}

export default SubHeader
